import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';
import Contacts from "./Contacts";
import Messages from "./Messages";
import Contact from "./Contact";


const Dialogs = (props) => {

	let contactArr = [
		{ id: 0, name: "Даун Иваныч" },
		{ id: 1, name: "Даун Лохыч" }
	]

	let contactElements = contactArr.map(c =>
		<Contact id={c.id} name={c.name} />
	);

	let messageArr = [
		{ id: 0, message: "lorem" },
		{ id: 1, message: "Lorem ipsum dolor sit amet." },
		{ id: 3, message: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Modi, nobis mollitia?" }
	]

	let messageNew = messageArr.map(m =>
		<Message id={m.id} message={m.message} />
	);


	return (
			<div className={classes.dialogBox}>
				<Contacts contact={contactElements}/>
				<Messages mexxageTxt={messageNew}/>
			</div>
		
	);
}

export default Dialogs;
